import React, { useEffect, useState } from 'react'
import '../details/Showsave.css'


const months = {
    '1': 'Jan',
    '2': 'Feb',
    '3': 'Mar',
    '4': 'Apr',
    '5': 'May',
    '6': 'Jun',
    '7': 'Jul',
    '8': 'Aug',
    '9': 'Sep',
    '10': 'Oct',
    '11': 'Nov',
    '12': 'Dec',
};


const quaterly = {
    1: ['1', 'Jan'],
    2: ['4', 'Apr'],
    3: ['7', 'July'],
    4: ['10', 'Oct']
}




function Showsave({ data }) {

    const [duration, setDuration] = useState('monthly');
    const [categories, setCategories] = useState([])
    const [records, setRecords] = useState({})
    const durationSelector = () => {

        return (
            <>
                <select value={duration} onChange={(e) => setDuration(e.target.value)}>
                    <option value='monthly'>Monthly</option>
                    <option value='quaterly'>Quantery</option>
                    <option value='yearly'>Yearly</option>
                </select>
            </>
        )
    }

    const handleColSpan = () => records.length || 1;


    const getUniqueCategories = () => {
        const cats = [];
        for (let i = 0; i < data.length; i++) {
            const cat = data[i].category;
            if (!cats.includes(cat)) {
                cats.push(cat);
            }
        }
        setCategories(cats);
    };

    const getRecords = () => {
        const recs = [];
        let month = new Date().getMonth() + 1; // 1-12
        let year = new Date().getFullYear();

        for (let i = 0; i < 36; i++) {
            const mn = months[month.toString()];
            const shortYear = year.toString().slice(2, 4);
            const rec = mn+' '+shortYear
            const amts = []
            for( let j=0; j < categories.length ; j++)

            switch (duration) {
                case 'monthly':
                    month -= 1;
                    break;
                case 'quaterly':
                    month -= 3;
                    break;
                case 'yearly':
                    month -= 12;
                    break;
                default:
                    break;
            }

            while (month <= 0) {
                month += 12;
                year--;
            }
        }

        setRecords(recs);
    };



    useEffect(() => {
        if (data && data.length > 0) {
            getUniqueCategories();
            getRecords();
        }
    }, [data, duration]);


    useEffect(() => {

        console.log('this is cats', categories)
    }, [categories])

    const COLUMN_WIDTH = 100; // px
const VISIBLE_COLUMNS = 4;

return (
  <>
    <h4>Saving Insights</h4>
    <div
      style={{
        overflowX: 'auto',
        width: `${(VISIBLE_COLUMNS + 1) * COLUMN_WIDTH}px`, // +1 for Account col
        border: '1px solid #ccc',
      }}
    >
      <table
        style={{
          width: `${(records.length + 1) * COLUMN_WIDTH}px`, // +1 for Account col
          borderCollapse: 'collapse',
        }}
      >
        <thead>
          <tr>
            <th style={{ width: `${COLUMN_WIDTH}px` }}>Account</th>
            <th
              colSpan={records.length}
              style={{ width: `${records.length * COLUMN_WIDTH}px` }}
            >
              {durationSelector()}
            </th>
          </tr>
          <tr>
            <td></td>
            {records.map((val, key) => (
              <td key={key} style={{ width: `${COLUMN_WIDTH}px`, border: '1px solid #ccc', textAlign: 'center' }}>
                {val}
              </td>
            ))}
          </tr>
        </thead>
        <tbody>
          {categories.map((val, key) => (
            <tr key={key}>
              <td style={{ width: `${COLUMN_WIDTH}px`, border: '1px solid #ccc' }}>{val}</td>
              {records.map((_, i) => (
                <td key={i} style={{ width: `${COLUMN_WIDTH}px`, border: '1px solid #ccc' }}>
                  {/* Insert your data here */}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  </>
);

}

export default Showsave
